INSERT INTO `tweet_base_content` VALUES (1874, '1672623025748070401', 'ltc20', 'latest', 'BRC20Insight', '有些傻逼为什么要在 #ltc20 的社群里面骂创始人 luke ?\n\n人家不干了，你去写 #ord-litecoin 的协议啊\n人家不干了，你去更新 #ord-litecoin 的钱包啊\n人家不干了，你去做 #ltc20 的市场啊\n\n让开发者卖卖币赚点钱，人家才有动力继续写代码啊。', 627, 'https://twitter.com/BRC20Insight/status/1672623025748070401', NULL, '2023-06-24 23:09:39', '2023-06-25 09:20:27', '2023-06-25 09:20:27', '2023-06-25 17:27:11');
INSERT INTO `tweet_base_content` VALUES (1875, '1672614144762060802', 'ltc20', 'latest', 'guanbo996', '8月3日，39天后，莱特币即将迎来减半倒计时 #litecoin\n，不应该养成坏习惯去猜能涨跌多少。\n对于莱特币来说，它也在sec批准的4种代币中。总体都是利好更多一些的。\n我思考是，买了莱特币 #LTC 是干嘛用的。\n省去中间思考过程：应用在LTC20，下半年还可以乘着风跟一把\n如果未来验证思考不对，我再改进', 186, 'https://twitter.com/guanbo996/status/1672614144762060802', NULL, '2023-06-24 22:34:22', '2023-06-25 09:20:31', '2023-06-25 09:20:31', '2023-06-25 17:27:14');
